import AppRouter from "../../router";
import { NotificationTab } from "../components/Header";
import "./PageLayout.scss";
import ReactApexChart from 'react-apexcharts'
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import { isAbsolute } from "path";
import "./chat.css"
import  chart_room from "./chart_room.js"


class ChartRoom extends Component {
  constructor(props) {
    super(props);
    this.state = {
    online:false,
    }

  }



componentWillMount() {
    var profile_data = JSON.parse(sessionStorage.getItem("session_data"));
    this.setState({User_Name:profile_data['first_name'] + "  " + profile_data['last_name']});
    this.setState({User_Email:profile_data['email']});
}

  render() {

    return (
     <div class="row" onload="ajax();">
        <div class="col-xs-1"></div>
            <div class="col-xs-2" class="user_list">
                <div  class="user_header">
                    <span>Users List</span>
                </div>
                 <form  method='get' action='/chatting'>
                        <ul class="list-group">
                            <li class="list-group-item"> <a href="" >
                                     Raveendra Mokka
                           {this.state.online == true?
                            <span style="height: 12px;width: 12px;background-color: #1fc124;border-radius: 6px;
                            float: right;margin-top: 5px;"></span> :

                            <span style="height: 12px;width: 12px;background-color: #8a8a8a;border-radius: 6px;
                            float: right;margin-top: 5px;"></span>
                            }
                                </a>
                            </li>
                            <li class="list-group-item"> <a href="" >
                                     Raveendra

                            {this.state.online == true?
                            <span   class="online"style="height: 12px;width: 12px;background-color: #1fc124;border-radius: 6px;
                            float: right;margin-top: 5px;"></span> :

                            <span class="offline" style="height: 12px;width: 12px;background-color: #8a8a8a;border-radius: 6px;
                            float: right;margin-top: 5px;"></span>
                            }
                                </a>
                            </li>
                        </ul>
                  </form>
         </div>
      </div>

    );
  }
}

export default ChartRoom;
